import styled from "styled-components";
import BottomNavBar from "../../components/shared/BottomNavBar";
import {
  Container,
  MainBtn,
  ProcedureHeading,
  SelectionBox,
  SelectionMainText,
  SelectionSubText,
  colors,
} from "../../Styles";

interface Props {}

export default function BookingPage(props: Props) {
  return (
    <Container>
      <Heading>막걸리 찬가 놀러가기!</Heading>
      <SelectionBoxBooking>
        <SelectionMainText>다음주 수요일 오후 4시</SelectionMainText>
        <SelectionSubText>5명 참가예정</SelectionSubText>
      </SelectionBoxBooking>
      <SelectionBoxBooking>
        <SelectionMainText>다음주 수요일 오후 4시</SelectionMainText>
        <SelectionSubText>5명 참가예정</SelectionSubText>
      </SelectionBoxBooking>
      <Instruction>
        <InstructionHeading>식탁 모임은 이렇게 진행돼요</InstructionHeading>
      </Instruction>
      <MainBtnBooking>놀러가기</MainBtnBooking>
      <BottomNavBar selectedItem="feed" />
    </Container>
  );
}

const Heading = styled(ProcedureHeading)`
  padding-top: 50px;
  margin-left: 30px;
`;

const SelectionBoxBooking = styled(SelectionBox)`
  margin-top: 30px;
`;

const MainBtnBooking = styled(MainBtn)`
  margin-top: 30px;
`;

const Instruction = styled.div`
  width: 90%;
  margin-left: auto;
  margin-right: auto;
  margin-top: 30px;
  min-height: 200px;
  background-color: #f8fafd;
  border-radius: 5px;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const InstructionHeading = styled.p``;

const InstructionDetail = styled.p``;
